export default class Body extends Component {
    constructor(props) {
        super(props);
        this.state = { content: 'Product Page' };
    }

    showProduct = () => {
        this.setState({ content: 'Product Page' });
    };

    showCustomer = () => {
        this.setState({ content: 'Customer Page' });
    };

    componentDidMount() {
        this.props.setShowProduct(this.showProduct);
        this.props.setShowCustomer(this.showCustomer);
    }

    render() {
        return (
            <div>
                <Navbar />

                <div>{this.state.content}</div>
            </div>
        );
    }
}
